import React from 'react'
import { NavLink } from 'react-router-dom';

const Footer = () => {
    return(
        <>
        <footer className="footer">
            <div className="container">
                <div className="f-menu">
                    <ul>
                        <li>
                            <NavLink href="#">Facebook</NavLink>
                        </li>
                    </ul>
                </div>
            </div>
        </footer>
        </>
    )
}
export default Footer;
